{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<h3>\u0414\u043e XX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1742_%D0%B3%D0%BE%D0%B4\" title=\"1742 \u0433\u043e\u0434\">1742<\/a>&#160;\u2014 \u0432 \u0446\u0430\u0440\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u044b \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u044b<\/a> \u0431\u044b\u043b \u0438\u0437\u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D0%B0%D0%B7\" title=\"\u0423\u043a\u0430\u0437\">\u0443\u043a\u0430\u0437<\/a>, \u043f\u0440\u0435\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0449\u0438\u0439 \u043d\u0435\u043c\u0435\u0434\u043b\u0435\u043d\u043d\u043e \u0432\u044b\u0441\u043b\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%B5%D0%B8\" title=\"\u0415\u0432\u0440\u0435\u0438\">\u0435\u0432\u0440\u0435\u0435\u0432<\/a> \u0437\u0430 \u0433\u0440\u0430\u043d\u0438\u0446\u0443 \u0438 \u0432\u043f\u0440\u0435\u0434\u044c \u0438\u0445 \u043d\u0438 \u043f\u043e\u0434 \u043a\u0430\u043a\u0438\u043c \u043f\u0440\u0435\u0434\u043b\u043e\u0433\u043e\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044e<\/a> \u043d\u0435 \u0432\u043f\u0443\u0441\u043a\u0430\u0442\u044c, \u00ab\u0440\u0430\u0437\u0432\u0435 \u043a\u0442\u043e \u0438\u0437 \u043d\u0438\u0445 \u0437\u0430\u0445\u043e\u0447\u0435\u0442 \u0431\u044b\u0442\u044c \u0432 \u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u0435\u0440\u0435 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438\u0441\u043f\u043e\u0432\u0435\u0434\u0430\u043d\u0438\u044f\u00bb.<\/li><\/ul><h3>XIX \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B3%D0%B2%D0%B0%D0%B9\" title=\"\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\">\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0432\u043e\u0439\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D0%B3%D0%B2%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0430\u0440\u0430\u0433\u0432\u0430\u0439\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 1-\u0439 \u0417\u0430\u043a\u0430\u0432\u043a\u0430\u0437\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u0421\u043e\u0432\u0435\u0442\u043e\u0432 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BA%D1%83\" title=\"\u0411\u0430\u043a\u0443\">\u0411\u0430\u043a\u0443<\/a>) \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043b \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D0%BC%D0%B0%D1%80%D1%82%D0%B0\" title=\"12 \u043c\u0430\u0440\u0442\u0430\">12 \u043c\u0430\u0440\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a> \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u0439 \u0421\u043e\u044e\u0437 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a \u0417\u0430\u043a\u0430\u0432\u043a\u0430\u0437\u044c\u044f \u0432 \u0435\u0434\u0438\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BA%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0417\u0430\u043a\u0430\u0432\u043a\u0430\u0437\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0417\u0430\u043a\u0430\u0432\u043a\u0430\u0437\u0441\u043a\u0443\u044e \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0424\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u0443\u044e \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0443\u044e \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0432\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0439<\/a> \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BD%D0%BA%D0%B8%D0%BD\" title=\"\u041d\u0430\u043d\u043a\u0438\u043d\">\u041d\u0430\u043d\u043a\u0438\u043d<\/a>. \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BD%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B7%D0%BD%D1%8F\" title=\"\u041d\u0430\u043d\u043a\u0438\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0437\u043d\u044f\">\u041d\u0430\u043d\u043a\u0438\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0437\u043d\u044f<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0434\u043b\u0438\u043b\u0430\u0441\u044c 6 \u043d\u0435\u0434\u0435\u043b\u044c \u0438 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b\u043e \u0443\u0431\u0438\u0442\u043e, \u043f\u043e \u0440\u0430\u0437\u043d\u044b\u043c \u0434\u0430\u043d\u043d\u044b\u043c, \u043e\u0442 150 \u0434\u043e 300 \u0442\u044b\u0441. \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u0441\u0438\u043b\u044c\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B2%D0%BE%D0%B4%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435\">\u043d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A5%D1%83%D0%B0%D1%80%D0%B0%D0%B7&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0425\u0443\u0430\u0440\u0430\u0437 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0425\u0443\u0430\u0440\u0430\u0437\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D1%83\" title=\"\u041f\u0435\u0440\u0443\">\u041f\u0435\u0440\u0443<\/a>), \u0432\u044b\u0437\u0432\u0430\u043d\u043d\u043e\u0435 \u043e\u0442\u043a\u043e\u043b\u043e\u0432\u0448\u0438\u043c\u0441\u044f \u043a\u0443\u0441\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA\" title=\"\u041b\u0435\u0434\u043d\u0438\u043a\">\u043b\u0435\u0434\u043d\u0438\u043a\u0430<\/a>, \u0443\u043f\u0430\u0432\u0448\u0438\u043c \u0432 \u043e\u0437\u0435\u0440\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D1%8C%D0%BA%D0%B0%D0%BA%D0%BE%D1%87%D0%B0\" title=\"\u041f\u0430\u043b\u044c\u043a\u0430\u043a\u043e\u0447\u0430\">\u041f\u0430\u043b\u044c\u043a\u0430\u043a\u043e\u0447\u0430<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u043e \u043e\u0442 6 \u0434\u043e 7 \u0442\u044b\u0441\u044f\u0447 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u0439 \u0437\u0430\u043f\u0443\u0441\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82\" title=\"\u041a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\">\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0430\u043f\u043f\u0430\u0440\u0430\u0442\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BE%D0%BD%D0%B5%D1%80-6,_-7,_-8_%D0%B8_-9\" title=\"\u041f\u0438\u043e\u043d\u0435\u0440-6, -7, -8 \u0438 -9\">\u041f\u0438\u043e\u043d\u0435\u0440-8<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974_%D0%B3%D0%BE%D0%B4\" title=\"1974 \u0433\u043e\u0434\">1974<\/a> \u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D0%B8%D0%BB%D0%BE%D0%B2,_%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0443\u0440\u0438\u043b\u043e\u0432, \u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432 \u041a\u0443\u0440\u0438\u043b\u043e\u0432<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u043e\u0431\u0435\u0433 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>, \u0441\u043f\u0440\u044b\u0433\u043d\u0443\u0432 \u0441 \u0431\u043e\u0440\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D0%BE%D1%8E%D0%B7_(%D0%BF%D0%B0%D1%80%D0%BE%D1%82%D1%83%D1%80%D0%B1%D0%BE%D1%85%D0%BE%D0%B4)\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0421\u043e\u044e\u0437 (\u043f\u0430\